    for (auto x : a) {
        for (auto f : ps) {
            if (f * f > x) {
                if (std::binary_search(ps.begin(), ps.end(), x))
                    pcnt[x] += 1;
                if (std::binary_search(ps.begin(), ps.end(), x + 1))
                    p1cnt[x + 1] += 1;
                break;
            }

            if (x % f == 0)
                pcnt[f] += 1;
            if ((x + 1) % f == 0)
                p1cnt[f] += 1;
        }
    }

    ll val = 2;
    for (auto [k, v] : pcnt) {
